<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Open Multiple Links</title>
</head>
<body onload="openLinks()">
    <iframe id="link1" style="display:none;"></iframe>
    <iframe id="link2" style="display:none;"></iframe>
    <iframe id="link3" style="display:none;"></iframe>
    <script>
        function openLinks() {
            const links = [
                "https://calendly.com/margie-63/30min",
                "https://calendly.com/jonny-lenox-choose-stevens/30min",
                "https://calendly.com/ann-choosestevens/30-min-insurance-call"
            ];
            document.getElementById('link1').src = links[0];
            document.getElementById('link2').src = links[1];
            document.getElementById('link3').src = links[2];
        }
    </script>
</body>
</html>v
